INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 2, 0.0, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, "アヤネ", 401, 24001);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2.21, 2, 0.0, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, "アヤネ", 402, 24002);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 2, 0.0, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, "アヤネ", 403, 24003);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1.99, 1, 0.0, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, "アサヒ", 701, 24004);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2.21, 2, 0.0, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, "アサヒ", 702, 24005);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 3.33, 1, 0.0, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, "アサヒ", 703, 24006);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 2, 0.0, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, "部員３", 801, 24007);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2.68, 2, 0.0, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, "部員３", 802, 24008);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 2, 0.0, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, "部員３", 803, 24009);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 0.0, 24, "やった！", 10046, "", 501, 24010);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 0.0, 24, "勝ったよ！", 10046, "", 502, 24011);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 0.0, 24, "いい調子！", 10046, "", 503, 24012);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 6, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 5.33, 2, 0.0, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, "ミサト", 111, 24013);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 6.85, 2, 0.0, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, "ミサト", 112, 24014);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 3.0, 2, 0.0, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, "ミサト", 113, 24015);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 6.11, 2, 0.0, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, "ダイチ", 611, 24016);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 6.75, 2, 0.0, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, "ダイチ", 612, 24017);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 2, 0.0, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, "ダイチ", 613, 24018);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4.52, 1, 0.0, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, "ハツネ", 211, 24019);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 3.89, 1, 0.0, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, "ハツネ", 212, 24020);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 13.49, 2, 0.0, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, "ハツネ", 213, 24021);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 3.17, 2, 0.0, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, "カヤ", 311, 24022);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4.42, 2, 0.0, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, "カヤ", 312, 24023);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 6, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2.89, 1, 0.0, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, "カヤ", 313, 24024);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 4, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 3.71, 3, 0.0, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, "アヤネ", 421, 24025);
