INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4.34, 3, 0.0, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, "部員３", 821, 24027);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 0.0, 24, "いい勝負だったよ\nまたやろうね", 10046, "", 521, 24028);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", -360.0, 5.62, 2, 0.0, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, "ミサト", 101, 24029);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", -360.0, 9.58, 2, 0.0, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, "ミサト", 102, 24030);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", -360.0, 0.0, 2, 0.0, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, "ミサト", 103, 24031);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", -360.0, 9.13, 1, 0.0, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, "ミサト", 104, 24032);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", -360.0, 8.27, 2, 0.0, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, "ミサト", 105, 24033);
